static int Pbs_Fb_TmReq_verify_table(flatcc_table_verifier_descriptor_t *td)
{
    int ret;
    if ((ret = flatcc_verify_table_field(td, 0, 0, &Pbs_Fb_Header_verify_table) /* hdr */)) return ret;
    if ((ret = flatcc_verify_string_field(td, 1, 0) /* jobId */)) return ret;
    if ((ret = flatcc_verify_string_field(td, 2, 0) /* cookie */)) return ret;
    if ((ret = flatcc_verify_field(td, 3, 2, 2) /* event */)) return ret;
    if ((ret = flatcc_verify_field(td, 4, 2, 2) /* jobTid */)) return ret;
    if ((ret = flatcc_verify_union_field(td, 6, 0, &Pbs_Fb_TmBody_union_verifier) /* body */)) return ret;
    return flatcc_verify_ok;
}

